import React from "react";
import logo from "../images/logo.svg"
import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <header>
      <div className="header-container">
        <div className="logo-container">
            <img src={logo}></img>
        </div>
        <ul className="header-links">
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>
    </header>
  );
}
